import React from 'react';
import PopupWithForm from './PopupWithForm';

function DeleteCardPopup({isOpen, onClose}) {
    return (
        <PopupWithForm isOpen={isOpen} onClose={onClose} title={'Вы уверены?'} name={'delete-card'}>
            <button type="submit" className="popup__button popup__button_type_save popup__button_type_small">Да</button>
        </PopupWithForm>
    )

}

export default DeleteCardPopup;
